//     height: 100px;
// `;


class Page extends Component {
    render() {
        return (
            <div>
                <Meta />
                <Header />
                {/* <MyButton>Click Me</MyButton>
                <MyButton>Click Me</MyButton>
                <MyButton>Click Me</MyButton> */}
                {this.props.children}
            </div>
        )
    }
}

export default Page;
